import React from 'react';
import { motion } from 'framer-motion';
import './services.css'; 

const images = [
  { id: 1, src: 'data:image/jpeg;base64,', alt: 'Image 1', text: 'TALC FOR PAINTS' },
  { id: 2, src: 'data:image/jpeg;base64,', alt: 'Image 2', text: 'TALK FOR CERAMICS' },
  { id: 3, src: 'data:image/jpeg;base64,', alt: 'Image 3', text: 'TALK FOR PLASTIC' },
  { id: 4, src: 'data:image/jpeg;base64,', alt: 'Image 4', text: 'TALK FOR PAPER' },
  { id: 5, src: 'data:image/jpeg;base64,', alt: 'Image 5', text: 'TALK FOR PAPER' },
  { id: 6, src: 'data:image/jpeg;base64,', alt: 'Image 6', text: 'TALK FOR PAPER' },
  { id: 7, src: 'data:image/jpeg;base64,', alt: 'Image 7', text: 'TALK FOR GRASS' },
  { id: 8, src: 'data:image/jpeg;base64,', alt: 'Image 8', text: 'TALK FOR TABLETS' },
  
];


function YourComponent() {
  return (
    <div className="container">
      <div className="column">
        <span className="heading">Products and<br/> Services</span>
      </div>
      <div className="separator">
        <span>|</span>
      </div>
      <div className="column">
        <span className="company-info">
          Jaza Minerals -We commit to deliver quality that exceeds your expectations and strive to exceed the highest standards of the Global Market.
        </span>
      </div>
     
      <div class="container">
      <div className="row">
       
        <div className="image-container">
          {images.map((image) => (
            <motion.div
              key={image.id}
              whileHover={{ scale: 1.1 }}
              className="image-container"
            >
              <div className="image-overlay">
                <motion.img
                  initial={{ y: '100%' }}
                  animate={{ y: 0 }}
                  transition={{ type: 'spring', damping: 10, stiffness: 70 }}
                  src={image.src}
                  alt={image.alt}
                  className="image"
                />
                <div className="overlay-text">{image.text}</div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </div>
    </div>
  );
}




export default YourComponent;
